(79, 'widget_text', 'a:3:{i:1;a:0:{}s:12:\"_multiwidget\";i:1;i:3;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:566:\"<div dir=\"ltr\">Au cours de ma carrière, j’ai eu la chance de participer à de nombreux projets, en équipe et de manière indépendante.</div>\r\n<div dir=\"ltr\">J’ai développé un réseau précieux qui m’a beaucoup apporté, tant sur le plan professionnel que personnel.</div>\r\n<div dir=\"ltr\">Je suis persuadé qu’un travail acharné porte toujours ses fruits, et je sais que chaque jour qui passe me rapproche un peu</div>\r\n<div dir=\"ltr\">plus de mes objectifs. Découvrez mon portfolio et n’hésitez pas à me contacter si vous avez des questions.</div>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}}', 'yes'),
