(558, 'abc_text_unconfirmed', 'Hi [abc_first_name]!\nThank you for booking at Myriam Grimont. Your booking has not yet been confirmed. Please wait for an additional confirmation email.\n\nYour details:\nRoom type: [abc_calendar_name]\nRoom price: [abc_room_price]\nSelected extras: [abc_optional_extras]\nAdditional costs: [abc_mandatory_extras]\nDiscount: [abc_discount]\nTotal price: [abc_total_price]\nCheckin - Checkout: [abc_checkin_date] - [abc_checkout_date]\nNumber of guests: [abc_person_count]\nFull Name: [abc_first_name] - [abc_last_name]\nEmail: [abc_email]\nPhone: [abc_phone]\nAddress: [abc_address], [abc_zip] [abc_city], [abc_county], [abc_country] \nYour message to us: [abc_message]\n\nYour Myriam Grimont-Team', 'yes'),
(559, 'abc_subject_confirmed', 'Confirming your booking at Myriam Grimont - [abc_checkin_date] - [abc_checkout_date]', 'yes'),
(560, 'abc_text_confirmed', 'Hi [abc_first_name]!\nWe are happy to confirm your booking!\n\nYour details:\nRoom type: [abc_calendar_name]\nRoom price: [abc_room_price]\nSelected extras: [abc_optional_extras]\nAdditional costs: [abc_mandatory_extras]\nDiscount: [abc_discount]\nTotal price: [abc_total_price]\nCheckin - Checkout: [abc_checkin_date] - [abc_checkout_date]\nNumber of guests: [abc_person_count]\nFull Name: [abc_first_name] - [abc_last_name]\nEmail: [abc_email]\nPhone: [abc_phone]\nAddress: [abc_address], [abc_zip] [abc_city], [abc_county], [abc_country] \nYour message to us: [abc_message]\n\nIf you have any questions regard your stay, feel free to contact us.\n\nYour Myriam Grimont-Team', 'yes'),
(561, 'abc_subject_canceled', 'Canceling your booking at Myriam Grimont', 'yes'),
(562, 'abc_text_canceled', 'Hi [abc_first_name]!\nWe are very sorry to cancel your booking! We already had another reservation for your requested travel period.\nPlease check our website at http://localhost/wordpress for an alternative. We would be very happy to welcome you any time soon.\n\nYour Myriam Grimont-Team', 'yes'),
(563, 'abc_subject_rejected', 'Rejecting your booking at Myriam Grimont', 'yes'),
(564, 'abc_text_rejected', 'Hi [abc_first_name]!\nWe are very sorry to reject your booking! We already had another reservation for your requested travel period.\nPlease check our website at http://localhost/wordpress for an alternative. We would be very happy to welcome you any time soon.\n\nYour Myriam Grimont-Team', 'yes'),
