(2275, 'cerber_admin_info', '<table><tr><td><img style=\"float:left; margin-left:-10px;\" src=\"http://localhost/wordpress/wp-content/plugins/wp-cerber/assets/icon-128x128.png\"></td><td><h3>Highlights from WP Cerber Security 7.9.3</h3><ul><li>New settings for the Traffic Inspector firewall allow you to fine-tune its behavior. You can enable less or more restrictive firewall rules.</li><li>Troubleshooting of possible issues with scheduled maintenance tasks has been improved.</li><li>To make troubleshooting easier the plugin logs not only a lockout event but also logs and displays the reason for the lockout.</li><li>Compatibility with ManageWP and Gravity Forms has been improved.</li><li>The layout of the Activity and Live Traffic pages has been improved.</li><li>Bug fixed: The malware scanner wrongly prevents PHP files with few specific names in one particular location from being deleted after a manual scan or during the automatic malware removal.</li><li>Bug fixed: The number of email notifications might be incorrectly limited to one email per hour.</li></ul>	<p style=\"margin-top: 18px; font-weight: bold;\"><a href=\"https://wpcerber.com/?plugin_version=7.9.3\" target=\"_blank\">Read more on wpcerber.com</a></p>	<p style=\"margin-top: 24px;\"><span class=\"dashicons-before dashicons-email-alt\"></span> &nbsp; <a href=\"https://wpcerber.com/subscribe-newsletter/\">Subscribe to Cerber\'s newsletter</a></p>\r\n					<p><span class=\"dashicons-before dashicons-twitter\"></span> &nbsp; <a href=\"https://twitter.com/wpcerber\">Follow Cerber on Twitter</a></p>\r\n					<p><span class=\"dashicons-before dashicons-facebook\"></span> &nbsp; <a href=\"https://www.facebook.com/wpcerber/\">Follow Cerber on Facebook</a></p>\r\n				<p style=\"text-align:right;\">\r\n		<input type=\"button\" class=\"button button-primary cerber-dismiss\" value=\" &nbsp; Awesome! &nbsp; \"/></p></td></tr></table>', 'no'),
