(2840, 'widget_cl-itext', 'a:3:{i:3;a:14:{s:13:\"_widget_title\";s:8:\"Citation\";s:5:\"texts\";s:235:\"\"Il n’y a qu’une façon d’échouer, c’est d’abandonner avant d’avoir réussi.\"\r\n\"Il faut se concentrer sur ce qu’il nous reste et non sur ce qu’on a perdu.\"\r\n\"Ils le peuvent, parce qu’ils pensent qu’ils le peuvent.\"\";s:12:\"dynamic_bold\";s:0:\"\";s:14:\"animation_type\";s:6:\"zoomIn\";s:8:\"duration\";s:3:\"300\";s:5:\"delay\";s:1:\"8\";s:9:\"font_size\";s:4:\"20px\";s:16:\"font_size_mobile\";s:4:\"15px\";s:5:\"color\";s:7:\"#2b2b2b\";s:13:\"dynamic_color\";s:0:\"\";s:5:\"align\";s:6:\"center\";s:3:\"tag\";s:1:\"p\";s:8:\"el_class\";s:0:\"\";s:8:\"pll_lang\";s:2:\"fr\";}i:4;a:14:{s:13:\"_widget_title\";s:0:\"\";s:5:\"texts\";s:170:\"\"There is only one way to fail, it\'s to give up before you succeed.\"\r\n\"We have to focus on what we have, not what we have lost.\"\r\n\"They can, because they think they can.\"\";s:12:\"dynamic_bold\";s:0:\"\";s:14:\"animation_type\";s:6:\"zoomIn\";s:8:\"duration\";s:3:\"300\";s:5:\"delay\";s:1:\"8\";s:9:\"font_size\";s:4:\"20px\";s:16:\"font_size_mobile\";s:4:\"15px\";s:5:\"color\";s:0:\"\";s:13:\"dynamic_color\";s:0:\"\";s:5:\"align\";s:6:\"center\";s:3:\"tag\";s:1:\"p\";s:8:\"el_class\";s:0:\"\";s:8:\"pll_lang\";s:2:\"en\";}s:12:\"_multiwidget\";i:1;}', 'yes'),
