(174, 52, '_elementor_data', '[{\"id\":\"2c6d997f\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"41ef13a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"965600e\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/wordpress\\/wp-content\\/uploads\\/2018\\/10\\/piano-801707_960_720.jpg\",\"id\":31},\"image_size\":\"custom\",\"image_custom_dimension\":{\"width\":\"10000\",\"height\":\"200\"},\"caption\":\"r\\u00e9\\u00e9ducation piano\",\"link_to\":\"file\",\"open_lightbox\":\"yes\",\"caption_source\":\"custom\"},\"elements\":[],\"widgetType\":\"image\"},{\"id\":\"53afaa61\",\"elType\":\"widget\",\"settings\":{\"editor\":\"\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"1112400\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"67ef8b8\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"41cf204\",\"elType\":\"widget\",\"settings\":{\"title\":\"Qui suis-je ?\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"3f59658\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"10ab54e\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"6ac688d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<div class=\\\"gs\\\" style=\\\"padding-bottom: 20px; width: 1066.4px; color: #222222; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400;\\\"><div class=\\\"\\\"><div id=\\\":me\\\" class=\\\"ii gt\\\" style=\\\"font-size: 12.8px; direction: ltr; margin-top: 8px; position: relative;\\\"><div id=\\\":md\\\" class=\\\"a3s aXjCH \\\" style=\\\"overflow: hidden; font: small\\/1.5 Arial, Helvetica, sans-serif; outline: none;\\\" tabindex=\\\"-1\\\" role=\\\"gridcell\\\"><