x; border-bottom-right-radius: 1px; width: auto; background: #f2f2f2;\\\">\\u00a0<\\/div><\\/div><\\/div>\",\"align\":\"justify\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
