(35, 1, '2018-10-22 22:24:32', '2018-10-22 20:24:32', 'Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous !		\n			<h2>Qui suis-je ?</h2>		\n		Au cours de ma carrière, j\'ai eu la chance d\'avoir participé à de nombreux projets, en équipe et de manière indépendante. J\'ai développé un réseau précieux qui m\'a beaucoup apporté, tant sur le plan professionnel que personnel. Je suis persuadé qu\'un travail acharné porte toujours ses fruits, et je sais que chaque jour qui passe me rapproche un peu plus de mes objectifs. Découvrez mon portfolio et n\'hésitez pas à me contacter si vous avez des questions.    ', 'Bonjour tout le monde !', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2018-10-22 22:24:32', '2018-10-22 20:24:32', '', 1, 'http://localhost/wordpress/2018/10/22/1-revision-v1/', 0, 'revision', '', 0),
