(53, 1, '2018-10-22 22:46:19', '2018-10-22 20:46:19', '<figure><a href=\"http://localhost/wordpress/wp-content/uploads/2018/10/piano-801707_960_720.jpg\" data-elementor-open-lightbox=\"yes\">\r\n<img title=\"piano-801707_960_720\" src=\"http://localhost/wordpress/wp-content/uploads/elementor/thumbs/piano-801707_960_720-nxuiwbwrm799gbvpagtfhyntww3ssqr2i4em1679w0.jpg\" alt=\"piano-801707_960_720\" /> </a><figcaption></figcaption></figure>\r\n<h2>Qui suis-je ?</h2>\r\nAu cours de ma carrière, j\'ai eu la chance d\'avoir participé à de nombreux projets, en équipe et de manière indépendante. J\'ai développé un réseau précieux qui m\'a beaucoup apporté, tant sur le plan professionnel que personnel. Je suis persuadé qu\'un travail acharné porte toujours ses fruits, et je sais que chaque jour qui passe me rapproche un peu plus de mes objectifs. Découvrez mon portfolio et n\'hésitez pas à me contacter si vous avez des questions.', 'Myriam Grimont, qui suis-je ?', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2018-10-22 22:46:19', '2018-10-22 20:46:19', '', 1, 'http://localhost/wordpress/2018/10/22/1-revision-v1/', 0, 'revision', '', 0),
(55, 1, '2018-10-22 22:51:30', '2018-10-22 20:51:30', 'La rééducation par le geste est un processus qui permet de redonner un usage complet, plus précisément, de récupérer une motricité optimale de la main suite à une blessure ou un traumatisme sur un membre supérieur du corps qui a impacté la motricité de la main d\'un patient.', 'Qu\'est-ce que la rééducation par le geste ?', '', 'publish', 'open', 'open', '', 'quest-ce-que-la-reeducation-par-le-geste', '', '', '2018-12-26 12:55:31', '2018-12-26 11:55:31', '', 0, 'http://localhost/wordpress/?p=55', 0, 'post', '', 0),
