(154, 1, '2018-11-04 16:23:41', '2018-11-04 15:23:41', '<div class=\"gs\" style=\"padding-bottom: 20px; width: 1066.4px; color: #222222; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400;\">\r\n<div class=\"\">\r\n<div id=\":me\" class=\"ii gt\" style=\"font-size: 12.8px; direction: ltr; margin-top: 8px; position: relative;\">\r\n<div id=\":md\" class=\"a3s aXjCH \" style=\"overflow: hidden; font: small/1.5 Arial, Helvetica, sans-serif; outline: none;\" tabindex=\"-1\" role=\"gridcell\">\r\n<div dir=\"ltr\">\r\n<h2 dir=\"ltr\">Qui suis-je ?</h2>\r\n<div dir=\"ltr\"></div>\r\n<div dir=\"ltr\" style=\"text-align: left;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">Au cours de ma carrière, </span><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">j\'ai eu la chance d\'avoir participé à de nombreux projets, en équipe et de manière indépendante. </span></div>\r\n<div dir=\"ltr\" style=\"text-align: left;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">J\'ai développé un réseau précieux qui m\'a beaucoup apporté, tant sur le plan professionnel que personnel. </span></div>\r\n<div dir=\"ltr\" style=\"text-align: left;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">Je suis persuadé qu\'un travail acharné porte toujours ses fruits, et je sais que chaque jour qui passe me rapproche un peu </span></div>\r\n<div dir=\"ltr\" style=\"text-align: left;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">plus de mes objectifs. Découvrez mon portfolio et n\'hésitez pas à me contacter si vous avez des questions.</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Myriam Grimont, qui suis-je ?', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2018-11-04 16:23:41', '2018-11-04 15:23:41', '', 1, 'http://localhost/wordpress/2018/11/04/1-revision-v1/', 0, 'revision', '', 0),
(155, 1, '2018-11-04 16:24:44', '2018-11-04 15:24:44', '<div class=\"gs\" style=\"padding-bottom: 20px; width: 1066.4px; color: #222222; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400;\">\n<div class=\"\">\n<div id=\":me\" class=\"ii gt\" style=\"font-size: 12.8px; direction: ltr; margin-top: 8px; position: relative;\">\n<div id=\":md\" class=\"a3s aXjCH \" style=\"overflow: hidden; font: small/1.5 Arial, Helvetica, sans-serif; outline: none;\" tabindex=\"-1\" role=\"gridcell\">\n<div dir=\"ltr\">\n<h2 dir=\"ltr\">Qui suis-je ?</h2>\n<div dir=\"ltr\" style=\"text-align: justify;\"></div>\n<div dir=\"ltr\" style=\"text-align: justify;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">Au cours de ma carrière, </span><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">j\'ai eu la chance d\'avoir participé à de nombreux projets, en équipe et de manière indépendante. </span></div>\n<div dir=\"ltr\" style=\"text-align: justify;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">J\'ai développé un réseau précieux qui m\'a beaucoup apporté, tant sur le plan professionnel que personnel. </span></div>\n<div dir=\"ltr\" style=\"text-align: justify;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">Je suis persuadé qu\'un travail acharné porte toujours ses fruits, et je sais que chaque jour qui passe me rapproche un peu </span></div>\n<div dir=\"ltr\" style=\"text-align: justify;\"><span style=\"color: #000000; font-family: raleway, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: 400; background-color: transparent;\">plus de mes objectifs. Découvrez mon portfolio et n\'hésitez pas à me contacter si vous avez des questions.</span></div>\n</div>\n</div>\n</div>\n</div>\n</div>', 'Myriam Grimont, qui suis-je ?', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2018-11-04 16:24:44', '2018-11-04 15:24:44', '', 1, 'http://localhost/wordpress/2018/11/04/1-autosave-v1/', 0, 'revision', '', 0),
