INSERT INTO `wp_quotes` (`id`, `quote`, `author`, `photo`, `class`) VALUES
(1, 'A man can live and be healthy without killing animals for food; therefore, if he eats meat, he participates in taking animal life merely for the sake of his appetite. And to act so is immoral.', 'Leo Tolstoy', '', ''),
(2, 'I have from an early age abjured the use of meat, and the time will come when men such as I will look upon the murder of animals as they now look upon the murder of men.', 'Leonardo da Vinci', '', ''),
(3, 'Il n’y a qu’une façon d’échouer, c’est d’abandonner avant d’avoir réussi.', ' Georges Clemenceau', '', '');
