INSERT INTO `wp_trp_dictionary_fr_fr_en_gb` (`id`, `original`, `translated`, `status`, `block_type`) VALUES
(1, 'Myriam Grimont', '', 0, 0),
(2, 'Piano Pedagogy &#8211; Gesture Rehabilitation &#8211; Course Booking', '', 0, 0),
(3, 'Home', '', 0, 0),
(4, 'Reeducation by gesture', '', 0, 0),
(5, 'Piano lessons', '', 0, 0),
(6, 'New piano in Ezanville', '', 0, 0),
(7, 'Booking', '', 0, 0),
(8, 'English', '', 0, 0),
(9, 'Français', '', 0, 0),
(10, 'Tous les articles', '', 0, 0),
(11, 'Non classé', '', 0, 0),
(12, 'Citation inspirante', '', 0, 0),
(13, '« S’il y a un problème, il y a une solution. S’il n’y a pas de solution, alors ce n’est pas un problème. » Divers auteurs', '', 0, 0),
(14, 'De nouveaux piano à Ezanville', '', 0, 0),
(15, 'vitae dicta sunt explicabo &nbsp; “Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui&hellip;', '', 0, 0),
(16, 'Admin', '', 0, 0),
(17, '11 Nov 2018', '', 0, 0),
(18, 'Le lieu de la rééducation change !', '', 0, 0),
(19, 'vitae dicta sunt explicabo &nbsp; « Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui&hellip;', '', 0, 0),
(20, '04 Nov 2018', '', 0, 0),
(21, 'Des cours de piano à Ezanville ?', '', 0, 0),
(22, 'Section 1.10.32 du « De Finibus Bonorum et Malorum » de Ciceron (45 av. J.-C.) « Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut&hellip;', '', 0, 0),
(23, 'Qu&rsquo;est-ce que la rééducation par le geste ?', '', 0, 0),
(24, 'La rééducation par le geste est un processus qui permet de redonner un usage complet, plus précisément, de récupérer une motricité optimale de la main suite à une blessure ou un traumatisme sur un membre supérieur du corps qui a impacté la motricité de la main d&rsquo;un patient.', '', 0, 0),
(25, '22 Oct 2018', '', 0, 0),
(26, 'Qui suis-je ?', '', 0, 0),
(27, 'Au cours de ma carrière, j’ai eu la chance de participer à de nombreux projets, en équipe et de manière indépendante.\r\nJ’ai développé un réseau précieux qui m’a beaucoup apporté et\r\nje suis persuadé qu’un travail acharné porte toujours ses fruit.', '', 0, 0),
(28, 'myriamgrimont.com 2018 | Tous droits réservés', '', 0, 0),
(29, 'Pédagogie du piano &#8211; Rééducation du geste &#8211; Réservation de cours', '', 0, 0),
(30, 'Liste des langues', '', 0, 0);
